    at Sarigan in the Marianas Archipelago from 25 May - 09 June 2007, aboard the NOAA
    ship Hi'ialakai, during the Reef Assessment and Monitoring Program (RAMP) Cruise
    HI0703. Raw survey data included genus presence and relative abundance, and voucher
